	t.Log("Given the need to test processing different strings.")
	for testID, test := range tt {
		t.Logf("\t%s", test.when)

		var writer bytes.Buffer
		err := ProcessMessage(&writer, test.msg, filters, numFilter)
		if err != nil {
			t.Fatalf("\t%s\tTest %d:\tProcessMessage should not return an error : %v", failed, testID, err)
		}

		resp := writer.Bytes()
		if reflect.DeepEqual(resp, test.resp) {
			t.Logf("\t%s\t%s", succeed, test.should)
		} else {
			t.Logf("\t%s\tTest %d:\t%s", failed, testID, test.should)
			t.Logf("\t\tShould:\t\t%.50s...", test.resp)
			t.Errorf("\t\tReceived:\t%.50s...", resp)
		}
	}
